import React, { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBars, faGlobe } from '@fortawesome/free-solid-svg-icons';
import './navbar.css';

function Navbar() {
  // State to track which navbar is displayed
  const [navState, setNavState] = useState(0); // 0: hidden, 1: navbar1, 2: navbar2

  // Function to toggle between hidden, navbar1, and navbar2
  const handleNavbarToggle = () => {
    setNavState((prevState) => (prevState + 1) % 3); // Cycles through 0 -> 1 -> 2 -> 0
  };

  return (
    <nav className="navbar">
      {/* Hamburger menu button and logo are aligned on the same line */}
      <div className="navbar-header">
        <div className="navbar-hamburger" onClick={handleNavbarToggle}>
          <FontAwesomeIcon icon={faBars} />
        </div>
        <div className="navbar-logo">
          <h1>Business Solution</h1>
        </div>
      </div>

      {/* Conditional rendering for Navbar1 */}
      {navState === 1 && (
        <div className="navbar1 active">
          <ul className="navbar-menu">
            <li>Driver</li>
            <li>Rider</li>
            <li>Business</li>
            <li>Log in</li>
            <li>Sign up</li>
            <li><FontAwesomeIcon icon={faGlobe} /> En</li>
          </ul>
        </div>
      )}

      {/* Conditional rendering for Navbar2 with a different background color */}
      {navState === 2 && (
        <div className="navbar2 active">
          <ul className="navbar-menu2">
            <li>Products</li>
            <li>Solutions</li>
            <li>Customers</li>
            <li>Resources</li>
            <li>Contact us</li>
            <li>Get started</li>
          </ul>
        </div>
      )}
    </nav>
  );
}

export default Navbar;
